import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/navBar';

function App() {
  const appStyles = {
    backgroundColor: 'white',
    height: '200vh',
    minHeight: '100vh',
    overscrollBehavior: 'none',
    paddingTop: '20px', /* Adjust this padding to match the height of the notch area */
    /* Additional styles to extend background into notch */
    position: 'relative',
    zIndex: 1,
  };

  return (
    <div style={appStyles}>
      <Navbar />
    </div>
  );
}

export default App;
